import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <h1>Sign In</h1>

        <form>
           <label for="phoneno">Phone Number</label><br></br>
           <input type='number' id='phoneno'></input><br></br>
           <label for="phoneno">Pasword</label><br></br>
           <input type='number' id='phoneno'></input><br></br>
           <button>continue</button>
        </form>

      </header>
    </div>
  );
}

export default App;
